import React, { useState } from "react";
const App=()=>{
    // let num=0;
    let state=useState();
    cons [count,setCount]=useState(0);

    const IncNum=()=>{
       count++;
       setCount(count);
    //    console.log(count++);
    }
    return (
        <>
            <div className="CLICK">
            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
            </div>
        </>
    )
}
export default App;
